import React, { useState } from 'react'
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
export default function Signup() {
    let navigate = useNavigate();

    const [Credentials, setcredentials] = useState({
        name: "",
        password: "",
        email: "",
        usertype: "Coustomer"
    })
    const update = (e) => {
        setcredentials({ ...Credentials, [e.target.name]: e.target.value });
    }
    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            axios.post("http://localhost:5000/api/createuser", {
                Credentials
            })
        }
        catch (err) {
            console.log(err)
        }
    }

    // const handleclick = () => {
    //     let getSelectedvalue = document.querySelector('input[name="usertype"]:checked');
    //     if (getSelectedvalue != null) {
    //         setcredentials(Credentials.usertype = getSelectedvalue.value);
    //     }
    // }


    return (

        <>
            <section className="vh-100 bg-image"
                style={{ 'backgroundImage': `url('https://mdbcdn.b-cdn.net/img/Photos/new-templates/search-box/img4.webp')` }}>
                <div className="mask d-flex align-items-center h-100 gradient-custom-3">
                    <div className="container h-100">
                        <div className="row d-flex justify-content-center align-items-center h-100">
                            <div className="col-12 col-md-9 col-lg-7 col-xl-6">
                                <div className="card" style={{ 'borderRadius': '15px' }}>
                                    <div className="card-body p-5">
                                        <h2 className="text-uppercase text-center mb-3">Create an account</h2>

                                        <form action="POST">

                                            <div className="form-outline mb-2">
                                                <input type="text" name="name" id="form3Example1cg" className="form-control form-control-lg" value={Credentials.name} onChange={update} />
                                                <label className="form-label" htmlFor="form3Example1cg">Your Name</label>
                                            </div>

                                            <div className="form-outline mb-2">
                                                <input type="email" name="email" id="form3Example3cg" className="form-control form-control-lg" value={Credentials.email} onChange={update} />
                                                <label className="form-label" htmlFor="form3Example3cg">Your Email</label>
                                            </div>

                                            <div className="form-outline mb-2">
                                                <input type="password" id="form3Example4cg" className="form-control form-control-lg" name="password" value={Credentials.password} onChange={update} />
                                                <label className="form-label" htmlFor="form3Example4cg">Password</label>
                                            </div>

                                            <div className="d-md-flex justify-content-start align-items-center mb-4 py-2">
                                                <div className="form-check form-check-inline mb-0 me-4">
                                                    <input className="form-check-input" type="radio" name="usertype" id="Coustomer" onClick={handleclick}
                                                        value="Coustomer" />
                                                    <label className="form-check-label" htmlFor="coustomer">Coustomer

                                                    </label>
                                                </div>

                                                <div className="form-check form-check-inline mb-0 me-4">
                                                    <input className="form-check-input" type="radio" name="usertype" id="merchant"
                                                        value="Merchant" onClick={handleclick} />
                                                    <label className="form-check-label" htmlFor="merchant">Merchant</label>
                                                </div>
                                            </div>

                                            <div className="form-check d-flex justify-content-center mb-3">
                                                <input className="form-check-input me-2" type="checkbox" value="" id="form2Example3cg" />
                                                <label className="form-check-label" htmlFor="form2Example3g">
                                                    I agree all statements in <a href="#!" className="text-body"><u>Terms of service</u></a>
                                                </label>
                                            </div>

                                            <div className="d-flex justify-content-center">
                                                <button onClick={handleSubmit} type="button"
                                                    className="btn btn-success btn-block btn-lg gradient-custom-4 text-body">Register</button>
                                            </div>

                                            <p className="text-center text-muted mt-3 mb-0">Have already an account? <Link to="/login"
                                                className="fw-bold text-body"><u>Login here</u></Link></p>

                                        </form>

                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>


        </>
    )
}
